import React from 'react'

const navColor = {
  backgroundColor: '#e3f2fd',
};

const Welcome = (props) => {
  const u = props.uData;
  const greeting = 'Welcome to React';

  return <h1>{greeting} {u.name}</h1>;
};

// function based component
export default function header(data) {
  // accessing data coming from parent component
  const user = data.uData;
  const p = data.person;
  return (
    <div>
      <nav className="navbar navbar-expand-lg navbar-light" style={navColor}>
      <a className="navbar-brand" href="/">React Practice {user.name}</a>
      <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarColor03" aria-controls="navbarColor03" aria-expanded="false" aria-label="Toggle navigation">
        <span className="navbar-toggler-icon"></span>
      </button>

      <div className="collapse navbar-collapse" id="navbarColor03">
        <ul className="navbar-nav mr-auto">
          <li className="nav-item active">
            <a className="nav-link" href="/">Home</a>
          </li>
          <li className="nav-item">
            <a className="nav-link" href="/">Features</a>
          </li>
          <li className="nav-item">
            <a className="nav-link" href="/">Pricing</a>
          </li>
          <li className="nav-item">
            <a className="nav-link" href="/">About {p.name}</a>
          </li>
        </ul>
      </div>
      </nav>

      {/* call function */}
      <Welcome {...data} />

      {/* adding comments in jsx and using props */}
      {/* <div>{element}</div> */}
    </div>
  )
}
